import React from 'react';
import Add from './Add';
import Sub from './Sub';
import Div from './Div';
import Mult from './Mult';



const App = () => {
    return (
        <>
        <ul>
            <h1>The sum  of these two numbers is  <span> {Add(2,3)}</span></h1>
            <h1>The subtraction  of these two numbers is  <span> {Sub(90, 80)}</span></h1>
            <h1>The division  of these two numbers is  <span> {Div(30,2)}</span></h1>
            <h1>The multiplication  of these two numbers is  <span> {Mult(80,27)}</span></h1>
        </ul>
        </>
    )
}

export default App;
